import React from 'react'
import Footer from "./Footer";
import Navbar from "./Navbar";
import Webone from "./Webone";
import Webtwo from "./Webtwo";
import Webthree from "./Webthree";
import Webfour from "./Webfour";
import Webfive from "./Webfive";

function ServicesInnerPage() {
  return (
    <div>
         <Navbar />
      <Webone />
      <Webtwo />
      <Webthree />
      <Webfour />
      <Webfive />
         <Footer />
    </div>
  )
}

export default ServicesInnerPage
